long_desc.thetext:
The following test fails with a JavaModelException (does not exist) on #getParameterNames for binary types:

ASTParser parser = ASTParser.newParser(AST.JLS3);
parser.setIgnoreMethodBodies(true);
parser.setProject(javaProject);
IType type = javaProject.findType("TestEnum");
IBinding[] bindings = parser.createBindings(new IJavaElement[] { type }, null);
ITypeBinding typeBinding = (ITypeBinding) bindings[0];
IMethodBinding[] methods = typeBinding.getDeclaredMethods();
for(IMethodBinding method: methods) {
	if (method.isConstructor()) {
		IMethod element = (IMethod) method.getJavaElement();
		String[] parameterNames = element.getParameterNames();
		// BOOM
	}
}

The enum declaration:

public enum TestEnum {

	FirstValue("Zonk") {
		@Override
		public String toString() {
			return super.toString();
		}
	},
	SecondValue("Bla");

	String string;

	TestEnum(String string) {
		this.string = string;
	}

}

I can apply a local fix by using a handcrafted BinaryKey to obtain the enum constructor, e.g. use 

String[] parameterTypes = Signature.getParameterTypes(
  new BindingKey("Lx;.x(Ljava/lang/String;ILjava/lang/String;)").toSignature());
IMethod constructor = type.getMethod(name, parameterTypes);

The parameter types cannot be obtained from the BinaryMethod afterwards, since BinaryMethod.getParameterNames uses 

// let's see if we can retrieve them from the debug infos
char[][] argumentNames = info.getArgumentNames();
if (argumentNames != null && argumentNames.length == paramCount) {
  String[] names = new String[paramCount];
  for (int i = 0; i < paramCount; i++) {
    names[i] = new String(argumentNames[i]);
  }
  return this.parameterNames = names;
}

to read the param names from the debug information. The number of arguments in the info object is different from the number of arguments in the key. The paramCount == 3 but the argumentNames contain only a single entry ['string'] which is correct but fails to fulfil the condition.
